// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AgeCalculator {
    function calculateAge(uint currentAge, uint yearsBefore) public pure returns (uint) {
        require(currentAge >= yearsBefore, "Invalid input");
        return currentAge - yearsBefore;
    }
}

